def find_player(name):
    """Find a player by name (handles nicknames)."""
    name_lower = name.lower()
    nicknames = {
        "jsn": "Jaxon Smith-Njigba",
        "kw3": "Kenneth Walker III",
        "walker": "Kenneth Walker III",
        "maye": "Drake Maye",
        "diggs": "Stefon Diggs",
        "henry": "Hunter Henry",
        "kupp": "Cooper Kupp",
        "darnold": "Sam Darnold",
        "stevenson": "Rhamondre Stevenson",
        "henderson": "TreVeyon Henderson",
    }
    if name_lower in nicknames:
        return nicknames[name_lower]
    for player in PLAYER_GAME_LOGS.keys():
        if name_lower in player.lower():
            return player
    return None


def analyze_pbp(team, situation="all"):
    """Analyze play-by-play data for tendencies."""
    team_code = "SEA" if "sea" in team.lower() else "NE"
    plays = [p for p in OFFENSIVE_PLAYS if p[5] == team_code]
    
    def calc_run_pass(play_list):
        runs = sum(1 for p in play_list if p[7] == 'R')
        passes = sum(1 for p in play_list if p[7] == 'P')
        total = runs + passes
        if total == 0:
            return "No plays"
        return f"{runs} runs ({runs/total*100:.1f}%) vs {passes} passes ({passes/total*100:.1f}%)"
    
    result = f"**{team_code} Play-by-Play Analysis**\n\n"
    
    if situation in ["all", "1st_down"]:
        first_down = [p for p in plays if p[2] == 1]
        result += f"**1st Down:** {calc_run_pass(first_down)}\n"
    
    if situation in ["all", "2nd_down"]:
        second_down = [p for p in plays if p[2] == 2]
        result += f"**2nd Down:** {calc_run_pass(second_down)}\n"
    
    if situation in ["all", "3rd_down"]:
        third_down = [p for p in plays if p[2] == 3]
        result += f"**3rd Down:** {calc_run_pass(third_down)}\n"
        # 3rd and short vs long
        third_short = [p for p in plays if p[2] == 3 and p[3] <= 3]
        third_long = [p for p in plays if p[2] == 3 and p[3] >= 7]
        result += f"   3rd & Short (1-3): {calc_run_pass(third_short)}\n"
        result += f"   3rd & Long (7+): {calc_run_pass(third_long)}\n"
    
    if situation in ["all", "red_zone"]:
        red_zone = [p for p in plays if p[4] <= 20 and p[4] > 0]
        result += f"**Red Zone (inside 20):** {calc_run_pass(red_zone)}\n"
        goal_line = [p for p in plays if p[4] <= 5 and p[4] > 0]
        result += f"**Goal Line (inside 5):** {calc_run_pass(goal_line)}\n"
    
    if situation in ["all", "trailing"]:
        trailing = [p for p in plays if p[6] < 0]
        result += f"**When Trailing:** {calc_run_pass(trailing)}\n"
    
    if situation in ["all", "leading"]:
        leading = [p for p in plays if p[6] > 0]
        result += f"**When Leading:** {calc_run_pass(leading)}\n"
    
    # Top targets/rushers
    if situation == "all":
        passes = [p for p in plays if p[7] == 'P' and p[10]]
        runs = [p for p in plays if p[7] == 'R' and p[10]]
        
        from collections import Counter
        targets = Counter(p[10] for p in passes)
        rushers = Counter(p[10] for p in runs)
        
        result += "\n**Top Targets:**\n"
        for player, count in targets.most_common(5):
            result += f"   {player}: {count} targets\n"
        
        result += "\n**Top Rushers:**\n"
        for player, count in rushers.most_common(5):
            result += f"   {player}: {count} carries\n"
    
    return result


